function App() {
    const [showForm, setShowForm] = useState(false);

    const handleDodajOsobeClick = () => {
        setShowForm(true);
    };

    return (
        <div className="App">
            <OsobaList />
            <button onClick={handleDodajOsobeClick}>Dodaj OsobÄ™</button>
            {showForm && <DodajOsobeForm />}
        </div>
    );
}

export default App;
